 * 
 * @param {object} params 
 * @param {string} key
 * @param {string} slug
 */
const arrayToUrlString = (params, key, slug) => params[key].reduce( (acc, item, index) => {
  const amp = index === 0 ? '' : '&';
  return `${ acc }${ amp }${ key }[]=${ encodeURIComponent(item) }`;
}, slug);

